Nikita Kruschev [future Soviet premier] was in charge of the 1931/32 &quot;famine&quot; in the Ukraine, which killed 7 million. A truly authorised ‘holocaust’ of non-Jews, accordingly it only gets a tiny fraction of the attention afforded to a certain Zionist propaganda coup. Khruschev reportedly was born Solomon Perlmutter which would explain why the distinctly non-Ukrainian looking &quot;Kruschev&quot; was so willing to oversee the officially approved holocaust of millions of his so-called &quot;countrymen.&quot;

