„Meilės jausmas taurina žmogų, skatina keistis. Akivaizdų įsimylėjusiojo pokytį (sakoma, žmogus kaip ant sparnų, moteris pražydo, išgražėjo, vyras – nušvito, išsitiesė) ir didžiausią laimės pojūtį žmogus gauna, kai randa kitą žmogų, su kuriuo pasiekia rezonansą. Tai reiškia, kad atrandamas ne šiaip draugas, bet žmogus, kuris maksimaliai, savimi maitina, palaiko, stiprina visus pačius svarbiausius gyvybinius-jausminius poreikius. Nieko stipresnio negali būti, nes žmogaus gyvybė, siela, širdies virpesiai, jo emocijos arba jausmai – tai iš esmės viena ir tas pat.

Jei atrandamas toks žmogus, kuris lyg kamertonas muzikoje atvirpa, atsiliepia visu savimi į mūsų norus, poreikius, troškimus, juos suprasdamas ir papildydamas – nieko stipresnio gyvenime būti negali. Šeimos ar poros santykiuose tai vadinama emociniu ryšiu arba stipriais tarpusavio jausmais, arba tiesiog meile. Gamtos esame sukurti taip, kad pats stipriausias gyvybinis rezonansas įvyksta būtent tarp vyro ir moters. Kai žmonės pirmą kartą pajaučia tokį stiprų jaudinantį emocinių poreikių sutapimą – juos apima svaiginantis įsimylėjimo jausmas. 
Bet vienas pagrindinių uždavinių šeimoje yra šį jausmą palaikyti visą gyvenimą.&quot;

