Kitą rytą šie trys nuėjo į Mortos namus Betanėje pusryčių ir po to nedelsiant išėjo į Jeruzalę. Šitą Sabato rytą, kada Jėzus ir du jo apaštalai artinosi prie šventyklos, jie sutiko gerai žinomą elgetą, vyrą, kuris gimė aklas, sėdintį savo įprastoje vietoje. Nors Sabato dieną šitie elgetos išmaldų nei prašydavo, nei gaudavo, bet jiems buvo leidžiama šitaip sėdėti savo įprastose vietose. Jėzus sustojo ir pažvelgė į šį ubagą. Kada jis taip žiūrėjo į šitą vyrą, kuris buvo gimęs aklas, jam kilo mintis, kaip dar kartą jis galėtų atkreipti Sanhedrino ir kitų žydų lyderių ir religinių mokytojų dėmesį į savąją misiją žemėje.
Kada Mokytojas tebestovėjo ten prieš šį aklą vyrą, paskendęs giliose mintyse, tada Natanielius, mąstydamas apie šito vyro aklumo galimą priežastį, paklausė: &quot;Mokytojau, kas padarė nuodėmę, šitas vyras ar jo tėvai, kad jis turėjo gimti aklas?&quot; 
Rabinai mokė, jog visus tokius aklumo iš prigimties atvejus sukeldavo nuodėmės. Ne tik vaikai būdavo pradedami ir gimdavo nuodėmėje, bet vaikas galėjo gimti aklas kaip bausmė už kokią nors konkrečią nuodėmę, padarytą jo tėvo. Jie net mokė, jog ir pats vaikas gali nusidėti prieš jam gimstant šitame pasaulyje. Jie taip pat mokė, jog tokius defektus gali sukelti kokia nors motinos nuodėmė ar koks nors kitas aistros patenkinimas tuo metu, kada savo kūdikį ji nešioja įsčiose.
Visuose šituose regionuose, tebeegzistavo užsitęsęs tikėjimas į reinkarnaciją. Senesnieji žydų mokytojai, kartu su Platonu, Filonu, ir didele dalimi eseniečių, toleravo tokią teoriją, jog žmonės vieno įsikūnijimo metu gali nuimti tokį derlių, kokį jie buvo pasėję ankstesnėje egzistencijoje; šitaip jie tikėjo, kad per vieną gyvenimą jie atperka tas nuodėmes, kurias padarė per ankstesniuosius gyvenimus. Mokytojui buvo sunku priversti žmones tikėti, kad jų sielos ankstesniųjų egzistencijų neturėjo.
Tačiau, kad ir kaip tai atrodo nenuoseklu, nors ir buvo laikomasi požiūrio, jog toks aklumas yra dėl nuodėmės, bet žydai manė, jog duoti išmaldą šitiems akliems elgetoms yra didžiulio laipsnio nuopelnas. Šitie akli žmonės turėjo įprotį praeiviams nuolat skanduoti, &quot;O minkštaširdi, nusipelnyk padėdamas aklam.&quot; 
Jėzus ėmė aptarinėti šitą atvejį su Natanieliumi ir Tomu, ne tiktai dėl to, kad jis jau buvo nusprendęs šitą aklą vyrą panaudoti kaip tos dienos priemonę, kad dar kartą aiškiai atkreiptų žydų lyderių dėmesį į savąją misiją,
